import React from "react";
import {Tile} from '../tile/Tile';


export const TileList = ({tiles}) => {
     
 

  return (
    <div>
       {/* ({objArr.map( (value, index) => <Tile value={value} key={index}/>)}) */}
       {tiles.map((value, index) => (
        <Tile key={index} value={value} />
      ))}
    </div>
  );
};
